(() => {
  "use strict";
  document.addEventListener("DOMContentLoaded", () => {
    const e = document.querySelector(".burger"),
      t = document.querySelector(".overlay"),
      c = document.querySelector(".intro");
    document.querySelectorAll(".nav__link").forEach((c) => {
      c.addEventListener("click", () => {
        try {
          t.classList.contains("active") && e.click();
        } catch (e) {
          console.log(e.message);
        }
      });
    }),
      e.addEventListener("click", function () {
        try {
          JSON.parse(e.getAttribute("aria-expanded"))
            ? (t.classList.add("active"),
              c && c.classList.add("active"),
              e.classList.add("active"),
              (document.body.style.overflow = "hidden"))
            : (t.classList.remove("active"),
              c && c.classList.remove("active"),
              e.classList.remove("active"),
              (document.body.style.overflow = "auto"));
        } catch {}
      }),
      (() => {
        try {
          new Swiper(".mySwiper", {
            slidesPerView: "auto",
            freeMode: !0,
            spaceBetween: 16,
            breakpoints: {
              320: { slidesPerView: "auto", spaceBetween: 12 },
              575: { slidesPerView: 2, spaceBetween: 12 },
              768: { slidesPerView: "auto", spaceBetween: 12 },
              992: { slidesPerView: 4, spaceBetween: 16 },
            },
          }),
            new Swiper(".atmo__slider", {
              navigation: {
                nextEl: ".atmo__arrow-next",
                prevEl: ".atmo__arrow-prev",
              },
            });
        } catch {}
      })(),
      (() => {
        try {
          const e = document.querySelectorAll(".ques__question");
          e.forEach((e) => {
            e.addEventListener("click", (t) => {
              const c = e.querySelector(".ques__caption"),
                a = e.querySelector(".ques__top");
              e.classList.contains("collapsed")
                ? (e.classList.remove("active"),
                  c.classList.remove("active"),
                  a.classList.remove("active"))
                : (e.classList.add("active"),
                  c.classList.add("active"),
                  a.classList.add("active"));
            });
          }),
            e[0].click();
        } catch {}
      })(),
      (() => {
        try {
          const e = document.querySelector(".calc__salary");
          let t = new Event("changeValue");
          function c() {
            const t = document.querySelector('[data-row="days"] .calc__board'),
              c = document.querySelector('[data-row="hours"] .calc__board');
            let a = +t.textContent * (1e3 * c.textContent) * 4;
            (a = a.toLocaleString("en-US")), (e.textContent = "+ " + a + "$");
          }
          document.addEventListener("changeValue", (e) => {
            c();
          }),
            c();
          const a = (e, c = 4, a = { low: 4, high: 6 }) => {
            const s = document.querySelector(e),
              o = s.querySelector('[data-action="plus"]'),
              r = s.querySelector('[data-action="minus"]'),
              i = s.querySelector(".calc__board"),
              { low: n, high: d } = a;
            (i.textContent = c),
              c === n && r.setAttribute("disabled", !0),
              c === d && o.setAttribute("disabled", !0),
              o.addEventListener("click", () => {
                c < d &&
                  (c++,
                  (i.textContent = c),
                  c === d && o.setAttribute("disabled", !0),
                  c > n &&
                    r.getAttribute("disabled") &&
                    r.removeAttribute("disabled"),
                  document.dispatchEvent(t));
              }),
              r.addEventListener("click", () => {
                c > n &&
                  (c--,
                  (i.textContent = c),
                  c === n && r.setAttribute("disabled", !0),
                  c < d &&
                    o.getAttribute("disabled") &&
                    o.removeAttribute("disabled"),
                  document.dispatchEvent(t));
              });
          };
          a('[data-row="days"]', 4, { low: 4, high: 6 }),
            a('[data-row="hours"]', 6, { low: 6, high: 8 });
        } catch {}
      })(),
      (function () {
        try {
          Fancybox.bind("[data-fancybox]", { groupAttr: !1 });
        } catch {}
      })();
  });
})();
